@Client.on_message(filters.command("charging", cmd) & filters.me)
async def charging(client: Client, message: Message):
    txt = (
        message.text[10:]
        + "\n\n`Tesla Wireless Charging (beta) Started...\nDevice Detected: Nokia 1100\nBattery Percentage:` "
    )
    j = 10
    k = j
    for j in range(j):
        await message.edit(txt + str(k))
        k = k + 10
        await asyncio.sleep(1)
    await asyncio.sleep(1)
    await message.edit(
        "Tesla Wireless Charging (beta) Completed...\nDevice Detected: Nokia 1100 (Space Grey Variant)\nBattery Percentage: [100%](https://telegra.ph/file/a45aa7450c8eefed599d9.mp4)"
    )




